body:
When performing blocked matrix multiplication, matrix sub blocks are first re-arranged in a way for SIMD instructions to load them and perform dot product. This process is called packing. Currently we use on stack arrays for packing buffers. Sizes of these buffers are limited by multiple OS and language restrictions.

In many cases, when we multiply matrices A& B, B is constant (weights), where we can pre-pack it during session initialization. In this case we need one less packing buffer, so our blocks can be bigger.  

In this change, we instead use a thread local heap buffer as packing buffers, and unify the block sizes regardless of whether B is prepacked or not.  This removes the limitation to on stack buffers, making it easier to tune the blocking sizes down the road.

Perf test show significant boost to the speed of QGEMM in VNNI machines, when B is not pre-packed. They are now nearly on par with the scenario where B is pre-packed.  AVX machine shows smaller speedup when B is not pre-packed.

We see no noticeable performance change in ARM CPUs





